// rfc
import React from "react";

export default function SignUp() {
  return (
    <div
      className="SignUp"
      style={{
        backgroundImage: "url(" + "https://tsks.app/img/signin_balls.png" + ")",
      }}
    >
        <h1 className="caption">Sign Up</h1>

        <button className="button btn--border">
            <span className="button__icon"><ion-icon name="logo-google"></ion-icon></span>
            <span className="button__text">Continue with Google</span>
        </button>
        <button className="button btn--border">
            <span className="button__icon"><ion-icon name="logo-facebook"></ion-icon></span>
            <span className="button__text">Continue with Facebook</span>
        </button>

        <div className="separate">or</div>

        <input type="email" placeholder="Email" className="input input--border"/>
        <input type="password" placeholder="Password" className="input input--border"/>

        <button className="button btn--bg-pink">
            <span className="button__icon"><ion-icon name="logo-facebook"></ion-icon></span>
            <span className="button__text">Continue with Facebook</span>
        </button>

        <p>A</p>
    </div>
  );
}
